import { Link, useNavigate, useLocation } from 'react-router-dom'
import {useCroct, Slot} from '@croct/plug-react';
import React from 'react';
import { Suspense } from 'react';
import {ReactElement} from 'react';
type HomeBannerContent = {
  title: string,
  subtitle: string,
  cta: {
      label: string,
      link: string,
  },
};

 export default function Developer(): ReactElement {
  const croct = useCroct();
  croct.user.edit().set('custom.persona', 'developer').save();
  const history = useNavigate();
    function goBack(){
        history.goBack();
    }
  return (
    <Suspense fallback='wait...'>
    <Slot id="home-banner">
       {({title, subtitle, cta}: HomeBannerContent)  => (
      <div>
        <strong>{title}</strong>
        <p>{subtitle}</p>
        <a href={cta.link}>{cta.label}</a>
        <Link to="/">
          <button on>Voltar</button></Link>
      </div>
       )}
    </Slot>
    </Suspense>
  )
}
